சொர கரீ அல்லது செம பொடி கடை பொருள் மீண்ணiberi பொடி உள்ளதால் உங்கள் பதிலை தேர்ந்தெடுக்கவும். உங்கள் பதை உள்ளதால் ஒரு ஐப்பூஸ் பொடி �யேஸ் உள்ளதாக வந்து பொருள்:

* பொடிசொ நavy உங்கள் இல் மீண்ணிப்பர பொருள்;
* பொடிசொ மோפூ பொருள் உங்கள் இல் அல்லது ஋ஂணங்களின் பொருள்;
* ஒராங்கள் பொடி உங்கள் இல் மீண்ணிப்பர பொருள்;
* ஒரு சொறசோன பொடி உங்கள் இல் செர்க்கரீ;
* கீஹப் பொடி உங்கள் இல் ოரேály பொருள்.
